import React from 'react';
import PlayBtn from '../../components/playBtn/playBtn';

const radioList = props => (
    <li className='radios_list d-flex'>
        <PlayBtn color={props.themeStyle.all.yellowColor} size={28} clicked={() => props.clicked(props.url)} />
        <span className="name_radio" onClick={() => props.clicked(props.url)}>{props.name}</span>
    </li>
);

export default radioList
